import React, { Component } from 'react';
import Slider from 'react-slick';
import 'slick-carousel/slick/slick.css';
import 'slick-carousel/slick/slick-theme.css';
import "../welcome/Welcome.css";
import { Link  } from "react-router-dom";


class App extends Component {
    render() {
      const settings = {
        dots: true,
        autoplay: true,
        infinite: true,
        slidesToShow: 3,
        slidesToScroll: 1
      };
      return (
        <div className="container">
          <Slider {...settings}>
          <div><Link to="/babynamefinder" className="how-can">
                  <img src={babyname} alt="logo" width="200" height="200"/>
                 </Link></div>
          <div><img src={require('../images/baby-name-finder.png')} alt=""/></div>
          <div><img src={require('../images/baby-name-finder.png')} alt=""/></div>
          <div><img src={require('../images/baby-name-finder.png')} alt=""/></div>
          <div><img src={require('../images/baby-name-finder.png')} alt=""/></div>
          <div><img src={require('../images/baby-name-finder.png')} alt=""/></div>
          </Slider>
        </div>
      );
    }
  }

  export default App;
